import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Navbar from './components/Navbar'
import ListWorkers from './components/ListWorkers'


function App() {



  return (
    <Routes>
      <div className="container">
        <Navbar />
        <Route path='/' exact component={ListWorkers} />
      </div>
    </Routes>
  );
}

export default App;
